CREATE TABLE event_planners (
  event_planner_id SERIAL PRIMARY KEY,
  event_planner_name VARCHAR(100) NOT NULL,
  contact_email VARCHAR(255) UNIQUE,
  phone_number VARCHAR(15) UNIQUE
);

CREATE TABLE event_planners (
    planner_id INT PRIMARY KEY,
    planner_name VARCHAR(255) NOT NULL,
    contact_number VARCHAR(15),
    email VARCHAR(100) UNIQUE
);

CREATE TABLE Organizers (
    organizer_id INTEGER PRIMARY KEY,
    organizer_name VARCHAR(50),
    contact_email VARCHAR(50),
    phone_number VARCHAR(15)
);

CREATE TABLE Payments (
    payment_id INTEGER PRIMARY KEY,
    booking_id INTEGER,
    amount DECIMAL,
    payment_date DATE
);
